import React, { Component } from 'react';
import './About.css';

class About extends Component {
  render() {
    return(
      <div class="about">
        <p>Born in Yugoslavia. Raised in Croatia. Lived in Zagreb and Berlin. <br/><br/>
           Civil engineer, peculiar gardener, emerging illustrator, occasional photographer. <br/><br/>
          Proud owner of a canine trash can named Frida.<br/><br/> <strong>Opened for commisions!</strong>
        </p>
      </div>
    );
  }
}

export default About;
